import React from 'react';

interface InputFieldProps {
  type: string;
  name: string;
  id: string;
  placeholder: string;
  iconClass: string;
}

const InputField: React.FC<InputFieldProps> = ({ type, name, id, placeholder, iconClass }) => {
  return (
    <div className="inputFieldsWrapper" style={{position: "relative"}}>
      <input
        className="inputField"
        type={type}
        name={name}
        id={id}
        placeholder={placeholder}
        required
      />
      <i className={iconClass} style={{position: "absolute", top: "10px"}}></i>
    </div>
  );
};

export default InputField;
